import React from 'react';
import ReactMomentCountDown from 'react-moment-countdown';

export default function CountDownComponent () {
  const dateInFuture = new Date('2017-12-31');

  return (
    <ReactMomentCountDown toDate={dateInFuture} />
  );
};
